import { useState, useEffect } from 'react';
import axios from 'axios';
import WorksheetHero from '../components/Worksheets/hero';

const Worksheet = () => {
    const [books, setBooks] = useState([]);

    const getBooks = async () => {
        try {
            axios
                .get('https://app.prepanywhere.com/api/stu/static_books/all_books')
                .then((response) => {
                    setBooks(response.data);
                });
        } catch (err) {
            console.log('error while getting books', err);
        }
    };

    useEffect(() => {
        getBooks();
    }, []);

    console.log('Render WorkSheet');
    return (
        <>
            <WorksheetHero books={books} />
        </>
    );
};

export default Worksheet;
